import React, { useState, useEffect }from 'react'
import axios from 'axios'

function App() {
    const [users, setUsers] = useState([])
    useEffect(() => {
        axios.get('/users')
        .then(res => setUsers(res.data))
    }, [])

    return (
        <div>

        </div>
    )
}

export default App
